const List = ({ toDo, setToDo }) => {
  const deleteList = e => {
    const newToDo = toDo.filter(val => val !== e.target.value);
    setToDo(newToDo);
  };

  return (
    <div>
      <button onClick={deleteList}>完了</button>
      {toDo.content}
    </div>
  );
};

export default List;
